The European Parliament in collaboration with other member states has today passed a series of unprecedented measures to ensure Hungary's place in the international discussion. These measures include:
- Increasing the minimum amount of the EU's global impact, i.e. sharing ownership of non-traditional enterprises;
- Increasing the minimum number of companies that should be shareholders of Hungary;
- Remaining Kinshasa-like status for members of both chambers of the parliament.
